import './index.css';
import './App.css';
import React, { Component } from "react";
import TimeAdder from './TimeAdder';

export default class DisplayList extends Component {
    render() {
        return (
            <div>
                {this.props.list.map(piece =>
                    <div class="image_div">
                        <img src={piece.src} alt="blah" class="image" />
                        <div class="image_desc">
                            <div>
                                <div class="title_and_medium">
                                    <h1 class="name">{piece.name}</h1>
                                    <h1 class="medium"> - {piece.medium}</h1>
                                </div>
                                <h4 class="date">{piece.date}</h4>
                            </div>
                            <h3>{piece.award}</h3>
                            <div class="time">
                                <h3>Time spent: {piece.time} hours</h3>
                                <TimeAdder />
                            </div>
                        </div>
                    </div>)
                }
            </div>
        )
    }

}
